shortDescription:
Здравствуйте! Меня зовут Динара Еркеновна, я репетитор начальных классов. Помогаю детям с 5 до 10 лет освоить школьную программу, восполнить пробелы в знаниях, развить уверенность в себе и интерес к учёбе.
Мои методики:
* Индивидуальный подход;
* Обучение через игру;
*Методика «от простого к сложному».

-Казахский Национальный университет имени Аль-Фараби (Бакалавриат 2018-2022);
-Университет Шакарим, (Магистратура -"Иностранный язык: Два иностранных языка") 2023-2025;
-Один год опыта работы в частной школе университета Шакарим, преподаватель английского языка;

Могу заниматься репетиторством по:
 •Казахскому языку (1-11 класс); 
•Математике (1-8 класс);

Помогу вам:
 • сформировать прочную базу знаний;
 • освоить и закрепить грамматику;
 • развить разговорные навыки;
 • с подготовкой к ЕНТ (при необходимости);
 • с освоением школьной программы (при необходимости)
Работаю с учениками средней/старшей школ и взрослыми.

Репетитор начальных классов
Опыт работы учителем — более 5 лет 
Работаю с детьми 1–4 классов (русское отделение).
Помогаю:
	•подтянуть знания по всем предметам;
	•подготовиться к СОР и СОЧ;
	•развить навыки чтения, письма и математики;
	•выполнить домашние задания.

✨ Индивидуальный подход к каждому ребёнку.

Учитель начальных  классов высшей категории, с опытом работы более 20 лет, оказываю услуги репетитора для детей начальной школы:         -Подготовка к школе;
--Подготовка домашнего задания;
 -Повторение учебного материала;
-Устранение пробелов в знаниях по математике, русскому языку;
- Подготовка к СОР, СОЧ;

Меня зовут Надежда. Я из Казахстан, сейчас живу в Италии:
- диплом в Канадском вузе на программе International Business;
- диплом Bachelor in Political Science and Economics в Италии;
- курсы международного права и Европейского права в Нидерландах (University of Groningen);
- Masters of Quantitative Economics and Finance в Милане;

Изучение китайского языка: полный курс!
В программе:
	•	Аудирование — понимай речь на слух;
	•	Грамматика — строй правильные фразы;
	•	Иероглифика — читай и пиши иероглифы;
	•	Разговорная речь — свободно общайся;
	•	Письменная речь — уверенно выражай свои мысли.

- Студентка СДУ, учусь по специальности научная математика;
- Формирую базу учащихся по математике;
- Принимаю учащихся 5-11 классов;
- Помогу с решением задач по математики к подготовки ЕНТ;
- Преподаю онлайн на платформе Google Meet, язык преподавания: казахский, английский

О себе:

студент технического вуза;

хорошее знание школьной программы;

ответственный, терпеливый, легко нахожу контакт с учениками.

Я умею: 
+преподнести информацию в максимально понятной форме; 
+индивидуально подходить к каждому из учащихся по их психологическим особенностям; 
+учить именно к тому, что понадобится в жизни, в учёбе и в различных ситуациях.  
+научиться быстро запоминать все что нужно и таким образом быстро освоить казахский.

Репетитор по математике. Мне 17 лет, бакалавр вуза ЕНУ.

/////

И по Математикалық сауаттылық. Я студент Вуза ЕНУ в бакалавр.17лет. Буду учить только знающий казахский язык.

Привет! Меня зовут Жания, Я:
• Победительница олимпиад по английскому языку на школьных, сетевых и Республиканских уровнях;
• Автор книги/гайда по написанию эссе разных типов на английском языке               (авторское право и рецензии имеются);
• Есть опыт работы с детьми;
• Качественные материалы и знания.

Открыт набор на курс: 

📚 Повышение успеваемости по школьной программе;
📚 Разбор домашних заданий;
📚 Подготовка к СОР/ СОЧ;
📚 Современная методика;
📚 Нейрозанятия;
📚 Индивидуальный подход;
📚 Качественное обучение;
📚 Инновационная платформа обучения;
📚 Преподаватель со стажем 10+ лет;
